import axios from "axios";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

export default function Queue() {

    const [queue, setQueue] = useState([]);

    useEffect(() => {
        axios.get("queue/get")
        .then((response) => setQueue(response.data))
        .catch((error) => {
            console.log(error);
        });
    }, []);

    return <div>
        Queue
        <Link to="/search">
            <button type="button">
                Button
            </button>
        </Link>
    </div>;
}
